const Dashboard=()=> {
  return (
    <div className="main-container">
   <div className="sidebar-container">
  <Sidebar/>
   </div>
   <div className="topcontent-container">
    <TopContent/>
   </div>
   <div className="maincontent-container">
    <MainContent/>
   </div>
    </div>
  );
}

export default Dashboard
